import React from "react";
import { Script } from "vm";

export default function ListCard({ title, list }) {
  const items = list.map((item, index) => <li key={index}>{item}</li>);

  if (list.length != 0) {
    <div className="card small">
      <div className="card-content">
        <h5>{title}</h5>
        <ul>{items}</ul>
      </div>
    </div>;
  } else {
    return <script />;
  }
}
